package com.thalhamer.numbersgame.domain;import android.view.View;import android.widget.ImageView;import com.thalhamer.numbersgame.enums.PowerEnum;/** * Created by Brian on 10/2/2015. */public class IapPower {    private View powerView;    private ImageView clickableTabImage;    private PowerEnum powerEnum;    public IapPower(View powerView, ImageView clickableTabImage, PowerEnum powerEnum) {        this.powerView = powerView;        this.clickableTabImage = clickableTabImage;        this.powerEnum = powerEnum;    }    public View getPowerView() {        return powerView;    }    public void setPowerView(View powerView) {        this.powerView = powerView;    }    public PowerEnum getPowerEnum() {        return powerEnum;    }    public void setPowerEnum(PowerEnum powerEnum) {        this.powerEnum = powerEnum;    }    public ImageView getClickableTabImage() {        return clickableTabImage;    }    public void setClickableTabImage(ImageView clickableTabImage) {        this.clickableTabImage = clickableTabImage;    }}